Let \[f(x) =
\begin{cases}
9x+4 &\text{if }x\text{ is an integer}, \\
\lfloor{x}\rfloor+5 &\text{if }x\text{ is not an integer}.
\end{cases}
\]Find $f(\sqrt{29})$.

In the diagram below, points $A$, $B$, $C$, and $P$ are situated so that $PA=2$, $PB=3$, $PC=4$, and $BC=5$. What is the maximum possible area of $\triangle ABC$? [asy]
defaultpen(linewidth(0.8)); size(150);
pair B = (0,0), C = (5,0), A = (2,3), P = (2.2,2);
draw(A--B--C--cycle^^B--P^^C--P^^A--P);
label("$A$",A,N); label("$B$",B,S); label("$C$",C,S); label("$P$",P,S);
[/asy]

In rectangle $ABCD$, $AB = 3$ and $BC = 9$. The rectangle is folded so that points $A$ and $C$ coincide, forming the pentagon $ABEFD$. What is the length of segment $EF$? Express your answer in simplest radical form.

[asy]
size(200);
defaultpen(linewidth(.8pt)+fontsize(10pt));
draw((0,0)--(9,0)--(9,3)--(0,3)--(0,0)--cycle);
draw((17,3)--(12,3)--(12,0)--(21,0),dashed);
draw((21,3)--(17,3)--(16,0)--(16+3.2,-2.4)--(21,0)--(21,3)--cycle);
draw((17,3)--(21,0));

label("A", (0,3), NW);
label("B", (0,0), SW);
label("C", (9,0), SE);
label("D", (9,3), NE);
label("B", (19.2,-2.4), SE);
label("D", (21,3), NE);
label("E", (16,0), SW);
label("F", (17,3), N);
label("A$\&$C", (21,0), SE);
[/asy]

For the data whose frequency histogram is shown, by how many days is the mean number of days missed per student greater than the median number of days missed per student for the 15 students? Express your answer as a common fraction.

[asy]
draw((0,0)--(0,6),linewidth(2));
draw((0,0)--(6,0),linewidth(2));

draw((0,0)--(1,0)--(1,3)--(0,3)--(0,0)--cycle,linewidth(2));
draw((1,0)--(2,0)--(2,1)--(1,1)--(1,0)--cycle,linewidth(2));
draw((2,0)--(3,0)--(3,4)--(2,4)--(2,0)--cycle,linewidth(2));
draw((3,0)--(4,0)--(4,1)--(3,1)--(3,0)--cycle,linewidth(2));
draw((4,0)--(5,0)--(5,1)--(4,1)--(4,0)--cycle,linewidth(2));
draw((5,0)--(6,0)--(6,5)--(5,5)--(5,0)--cycle,linewidth(2));

draw((0,1)--(6,1),dashed);
draw((0,2)--(6,2),dashed);
draw((0,3)--(6,3),dashed);
draw((0,4)--(6,4),dashed);
draw((0,5)--(6,5),dashed);

label("0",(.5,0),S);
label("1",(1.5,0),S);
label("2",(2.5,0),S);
label("3",(3.5,0),S);
label("4",(4.5,0),S);
label("5",(5.5,0),S);

label("1",(0,1),W);
label("2",(0,2),W);
label("3",(0,3),W);
label("4",(0,4),W);
label("5",(0,5),W);

label("Number of School Days Missed",(2.5,8));
label("by Mr. Clark's Students",(2.5,7));

label("$\#$ of Days of School Missed",(3,-2));

label(rotate(90)*"$\#$ of Students",(-2,2));
[/asy]

Parallelepiped $ABCDEFGH$ is generated by vectors $\overrightarrow{AB},$ $\overrightarrow{AD},$ and $\overrightarrow{AE},$ as shown below.

[asy]
import three;

size(220);
currentprojection = orthographic(0.5,0.3,0.2);

triple I = (1,0,0), J = (0,1,0), K = (0,0,1), O = (0,0,0);
triple V = (-1,0.2,0.5), W = (0,3,0.7), U = (-0.8,0.5,2);

draw(surface(O--W--(W + U)--U--cycle),gray(0.7),nolight);
draw(surface(U--(V + U)--(U + V + W)--(W + U)--cycle),gray(0.9),nolight);
draw(surface(W--(V + W)--(U + V + W)--(W + U)--cycle),gray(0.5),nolight);
draw(O--(-3*I), dashed, Arrow3(6));
draw(O--3*J, Arrow3(6));
draw(O--3*K, Arrow3(6));
draw(U--(V + U)--(U + V + W)--(V + W)--W);
draw(U--(W + U)--(U + V + W));
draw((W + U)--W);
draw((V + U)--V--(V + W),dashed);
draw(O--V,dashed,Arrow3(6));
draw(O--W,Arrow3(6));
draw(O--U,Arrow3(6));

label("$x$", -3.2*I);
label("$y$", 3.2*J);
label("$z$", 3.2*K);
label("$A$", (0,0,0), SW, fontsize(10));
label("$E$", U, NW, fontsize(10));
label("$B$", V, NW, fontsize(10));
label("$D$", W, S, fontsize(10));
label("$F$", U + V, N, fontsize(10));
label("$H$", U + W, NW, fontsize(10));
label("$C$", V + W, SE, fontsize(10));
label("$G$", U + V + W, NE, fontsize(10));
[/asy]

Compute
\[\frac{AG^2 + BH^2 + CE^2 + DF^2}{AB^2 + AD^2 + AE^2}.\]
